import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Hei, jeg heter Taheera Ahmed
        </h1>
        <p>
          Jeg besemte meg for å lage en nettside fordi jeg kjeder meg
          og trengte noe å gjøre i sommerferien, uten å bli helt dø på innsiden
        </p>
      </header>
    </div>
  );
}

export default App;
